export default class PokedexPage extends Component {
    
    state = {
        data : [],
        page : ""
    }
    
    async componentDidMount() {

        if (this.props.match.params.id) {
            const res = await axios.get('https://practica-mern-stack.herokuapp.com/api/notes/' + this.props.match.params.id);
            this.setState({
                _id: this.props.match.params.id
            })
        }

    }

    render() {
        return (
            <div>
                Pokedex Page
            </div>
        )
    }
}
